import React from 'react';

const Bar = ({ icon, name, level }) => {
    return (
        <div className="bar">
            <div className="bar_wrapper">
                <span className="bar_name">
                    <img src="" alt=""/>
                </span>
            </div>
        </div>
    );
};

export default Bar;
